import React, {useEffect} from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.css';
import './App.css';
import Title from './components/Title';
import Navbar from './components/Navbar';
import Home from './components/Home';
import Favorites from './components/Favorites';
import Review from './components/Review';
import LoginForm from './components/LoginForm';
import MyRestaurant from './components/MyRestaurant';
import Cuisines from './components/Cuisines';
import Footer from './components/Footer';

function App() {

  const appName="TuleWapi Restaurant Advisor"

  useEffect(()=>{
    document.title = appName
  },[appName])

  return (
    <Router>
      <div className="App">
        <Title />
        <Navbar />
        <Routes>
          <Route path="/#" element={Home} />
          <Route path="/Favorites" element={Favorites} />
          <Route path="/Review" elemeent={Review} />
          <Route path="/LoginForm" component={LoginForm} />
          <Route path="/Cuisines" component={Cuisines} />
          <Route path="/MyRestaurant/:id" component={MyRestaurant} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
  }

export default App;
